def matrixMultiply(m1, m2):
    # your code goes here
    if(len(m1[0])!=len(m2)):
        return(None)
    res=[[0 for i in range(len(m2[0]))] for j in range(len(m1))]
    for i in range(len(m1)):
        for j in range(len(m2[0])):
            for k in range(len(m2)):
                res[i][j]+=m1[i][k]*m2[k][j]
    return(res)
